import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";

import "swiper/css";

export default function GameList() {
  return (
    <div className="game-list">
      <Swiper
        spaceBetween={50}
        slidesPerView={3}
        onSlideChange={() => console.log("slide change")}
        onSwiper={(swiper) => console.log(swiper)}
      >
        <SwiperSlide>
          <img src="https://img.g2a.com/323x433/1x1x0/disneys-hercules-pc-steam-key-europe/5f5b35d27e696c63c667cf32" />
        </SwiperSlide>
        <SwiperSlide>
          <img src="https://m.media-amazon.com/images/I/511V6QBV6PL._AC_.jpg" />
        </SwiperSlide>
        <SwiperSlide>
          <img src="data:image/jpeg;base64," />
        </SwiperSlide>
        <SwiperSlide>
          <img src="https://img.g2a.com/323x433/1x1x0/disneys-hercules-pc-steam-key-europe/5f5b35d27e696c63c667cf32" />
        </SwiperSlide>
      </Swiper>
    </div>
  );
}
